import './Profile.css';
import './style.css';

export default function About() {


    return (
        <div className = "profile-section">
            <div class = "about-box">
                <div className="section-title">About</div>
                <div clasName = "entry-desc">I am currently a senior at Carnegie Mellon University studying at the intersection of design, computer science, behavioral science, and statistics. My specific area of interest is in the development and design of music streaming platforms. </div>
            </div>

        </div>

    );

};
